  false,\n\t\"url\": null,\n\t\"notes\": \"The land cover/land use database was developed
  from color infrared aerial photography flown on August 26, 1997 at a scale of 1:15,840.
  \ Photographs were flown with 60% overlap and 30% sidelap on a cloud free day.  Aerial
  photographs were ground truthed prior to interpretation to assure accurate identification
  of class types during mapping.  Interpretation was performed using mirrored stereoscopes
  with a minimum mapping unit (mmu) of .5 hectares (1.2 acres).  Land cover types
  are mapped to .1 hectares (__acres) when unique from surrounding land cover types.
  \ The interpreted photographs were transferred to mylar overlays registered to USGS
  7.5' quadrangle enlargements at a scale of 1:15,000 before being manually digitized.
  \ Quality control measures were performed on each step of this process.\",\n\t\"license_title\":
